  [1105137265]="<color=#dd0f0f>踢馆</color>是什么？",
  [1105137266]="所谓<color=#dd0f0f>踢馆</color>可是江湖中一种<color=#dd0f0f>重要的功能</color>，这个江湖中共有大大小小<color=#dd0f0f>数十个门派</color>，都可以进行<color=#dd0f0f>踢馆</color>。",
  [1105137267]="<color=#dd0f0f>踢馆</color>需要进行<color=#dd0f0f>连续三场战斗</color>，称之为<color=#dd0f0f>车轮战</color>，<color=#dd0f0f>而车轮战中每个队友只能上阵一次</color>。",
  [1105137268]="<color=#dd0f0f>踢馆</color>若是成功后可以选择与该门派进行<color=#dd0f0f>驱逐掌门、结盟甚至征服</color>，乃至获得门派传家宝。失败则会被关入大牢一个月！",
